import React from 'react';
import {createMuiTheme} from '@material-ui/core/styles'
import MuiThemeProvider from '@material-ui/core/styles/MuiThemeProvider'
import './App.css';
import SignupLayout from './hoc/layouts/SignupLayout'

const theme = createMuiTheme({
  palette: {
    primary: {main: '#FFFF00'},
    secondary: {main: '#FFFF00'}
  }
});

const facebook_theme = createMuiTheme({
  palette: {
    primary: {main: '#3b5998'}
  }
})

function App() {
  return (
    <div className="App">
      <SignupLayout/>
    </div>
  );
}

export default App;
